    GitHub: {
        link: "https://www.github.com",
        text: "Nafissa Atlagh",
        icon: <GitHubIcon />
    },
    Facebook: {
        link: "https://www.facebook.com",
        text: "Molaiea Tssooe",
        icon: <FacebookIcon />
    }
}
